const HabitsPage = () => {
    const [name, setName] = useState<string>('');

    return (
        <>  
        <table className={styles.layout}>
            <Habits/>
        </table>
        <div>
            Новая привычка
        </div>
        <div>
            <Input type="text" onChange={(e) => setName(e.target.value)} value={name} />
            <Button onClick={addNewHabit}> 
                SEND
            </Button>
        </div>
        </>


    );
};

export default HabitsPage;
